package vendor.bean;

public class POProduct {
	
	
	private String poNo;
	private String productId;
	private double quantity;
	
	
	
	public POProduct(String poNo, String productId, double quantity) {
		super();
		this.poNo = poNo;
		this.productId = productId;
		this.quantity = quantity;
	}
	public String getPoNo() {
		return poNo;
	}
	public void setPoNo(String poNo) {
		this.poNo = poNo;
	}
	public String getProductId() {
		return productId;
	}
	public void setProductId(String productId) {
		this.productId = productId;
	}
	public double getQuantityNo() {
		return quantity;
	}
	public void setQuantityNo(double quantity) {
		this.quantity = quantity;
				}
	
}
